import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      const offset = 80;
      const elementPosition = element.getBoundingClientRect().top + window.pageYOffset;
      window.scrollTo({
        top: elementPosition - offset,
        behavior: 'smooth'
      });
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark fixed-top custom-navbar">
      <div className="container">
        <Link className="navbar-brand" to="/">
          <img src="/logo.png" alt="LivingLink Logo" className="navbar-logo" />
          LivingLink
        </Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <Link className="nav-link" to="/">Home</Link>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#features" onClick={(e) => {
                e.preventDefault();
                scrollToSection('features');
              }}>Features</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#testimonials" onClick={(e) => {
                e.preventDefault();
                scrollToSection('testimonials');
              }}>Testimonials</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#about" onClick={(e) => {
                e.preventDefault();
                scrollToSection('about');
              }}>About</a>
            </li>
            <li className="nav-item">
              <Link className="btn btn-outline-light ms-2" to="/login">Login</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Header;
